            <
            div >
            <
            BrowserRouter >
            <
            Navbar / >
            <
            Routes >
            <
            Route exact path = "/"
            element = { <
                News key = "Home"
                pageSize = { 6 }
                country = "in"
                category = "general" / >
            }
            /> <
            Route exact path = "/entertainment"
            element = { <
                News
                key = "entertainment"
                pageSize = { 6 }
                country = "in"
                category = "entertainment" /
