            /> <
            Route exact path = "/health"
            element = { <
                News
                key = "health"
                pageSize = { 6 }
                country = "in"
                category = "health" /
                >
            }
            /> <
            Route exact path = "/science"
            element = { <
                News
                key = "science"
                pageSize = { 6 }
                country = "in"
                category = "science" /
                >
            }
            /> <
            Route exact path = "/sports"
            element = { <
                News
                key = "sports"
                pageSize = { 6 }
                country = "in"
                category = "sports" /
                >
            }
            /> <
            Route exact path = "/technology"
            element = { <
                News
                key = "technology"
                pageSize = { 6 }
                country = "in"
                category = "technology" /
                >
            }
            /> <
            /Routes> <
            /BrowserRouter> <
            /div>
        );
    }
}
